import {
  Menu,
  MenuItem,
  MenuRightSide,
  MenuRightSideItem,
  NavbarStyled,
  SeachModal,
  WrapperMenuAndLogo,
} from "./styles";

const Navbar = () => {
  return (
    <NavbarStyled>
      <WrapperMenuAndLogo>
        <img src="./images/logo.png" alt="Netflix" />

        <Menu>
          <MenuItem>BROWSE</MenuItem>
          <MenuItem>KIDS</MenuItem>
        </Menu>
      </WrapperMenuAndLogo>
    </NavbarStyled>
  );
};

export default Navbar;
